import shared from "./shared";
import user from "./user";
import product from "./product";
import store from "./store";
import setting from "./setting";
import productsBase from "./baseSetting";
import design from "./design";

export default [
  ...shared,
  ...user,
  ...store,
  ...product,
  ...setting,
  ...productsBase,
  ...design,
];
